import MainHeader from "./Body/MainHeader/MainHeader";
import AboutMe from "./Body/AboutMe/AboutMe";
import WebServices from "./Body/WebServices/WebServices";
import Skills from "./Body/Skills/Skills";
import Certificate from "./Body/Certificate/Certificate";
import Projects from "./Body/Projects/Projects";
import Social from "./Body/Social/Social";
import Footer from "./Body/Footer/Footer";
import ForSale from "./Body/ForSale/ForSale";
import Contact from "./Body/Contact/Contact";
import StripeContainer from "./Payment/StripeContainer";
import testItem from "../components/Body/ForSale/images/for_sale_yes/Alfa_Network/IMG_2867-min.JPG";

import classes from "./body.module.css";

import { Route } from "react-router-dom";

const Body = () => {
  return (
    <div className={classes.container} lang="en">
      <div>
        <MainHeader />
        <main>
          <Route path="/AboutMe">
            <AboutMe />
            <Social />
          </Route>
          <Route path="/WebServices">
            <WebServices />
          </Route>
          <Route path="/Certificate">
            <Certificate />
          </Route>
          <Route path="/Skills">
            <Skills />
          </Route>
          <Route path="/Projects">
            <Projects />
          </Route>
          <Route path="/ForSale">
            <ForSale />
          </Route>
          <Route path="/Social">
            <Social />
          </Route>
          <Route path="/Contact">
            <Contact />
          </Route>
        </main>
        {showItem ? (
          <StripeContainer />
        ) : (
          <>
            <h3>$10.00</h3> <img src={testItem} alt="Spatula" />
            <button onClick={() => setShowItem(true)}>Purchase Spatula</button>
          </>
        )}
        <Footer className={classes.footer} />
      </div>
    </div>
  );
};

export default Body;
